import React from "react";
import { Routes, Route } from "react-router-dom";
import Toaster from "react-hot-toast";
import Log from "./Log";
import Signup from "./Signup";
function App() {
  return (
    <div>
      <Toaster/>
      <Routes>
        <Route path="/" element={<Log/>}></Route>
        <Route path="/signup" element={<Signup/>}></Route>
      </Routes>
    </div>
  );
}
export default App;
